<!DOCTYPE html>
<html lang="zh-Hant">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
  <title>ANTI-GRAVITY SELF — Interactive Art</title>
  <style>
    body {
      margin: 0;
      overflow: hidden;
      background-color: #4DB3BF;
      touch-action: none;
    }

    /* Prevent pull-to-refresh */
    canvas {
      display: block;
    }

    #loading {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      color: white;
      font-family: sans-serif;
      font-size: 24px;
      pointer-events: none;
      text-shadow: 1px 1px 2px black;
      transition: opacity 0.5s;
    }

    #instructions {
      position: absolute;
      bottom: 20px;
      left: 50%;
      transform: translateX(-50%);
      color: rgba(255, 255, 255, 0.8);
      font-family: sans-serif;
      font-size: 16px;
      pointer-events: none;
      text-shadow: 1px 1px 2px black;
      width: 100%;
      text-align: center;
    }
  </style>
</head>

<body>
  <div id="loading">Loading Art Experience...</div>
  <div id="instructions">Drag Background to Rotate • Double Tap Cube to Launch</div>
  <script type="module">
    import * as THREE from 'https://unpkg.com/three@0.160.0/build/three.module.js';

    // --- Configuration ---
    const CONFIG = {
      cubeCount: 60,
      vaseCount: 25,
      floorColor: 0xE28546, // Sand Orange
      bgColor: 0x4DB3BF,    // Cyan Sky
      cubeSize: 2.5,
      vaseSize: 6,
      interactionRadius: 20,
      interactionStrength: 1.5
    };

    // --- Sound Manager (Web Audio API) ---
    class SoundManager {
      constructor() {
        this.ctx = new (window.AudioContext || window.webkitAudioContext)();
        this.enabled = false;
      }

      resume() {
        if (this.ctx.state === 'suspended') {
          this.ctx.resume();
        }
        this.enabled = true;
      }

      playGrab() {
        if (!this.enabled) return;
        const osc = this.ctx.createOscillator();
        const gain = this.ctx.createGain();

        osc.type = 'sine';
        osc.frequency.setValueAtTime(150, this.ctx.currentTime);
        osc.frequency.exponentialRampToValueAtTime(50, this.ctx.currentTime + 0.1);

        gain.gain.setValueAtTime(0.3, this.ctx.currentTime);
        gain.gain.exponentialRampToValueAtTime(0.01, this.ctx.currentTime + 0.1);

        osc.connect(gain);
        gain.connect(this.ctx.destination);
        osc.start();
        osc.stop(this.ctx.currentTime + 0.1);
      }

      playThrow() {
        if (!this.enabled) return;
        const bufferSize = this.ctx.sampleRate * 0.5; // 0.5 sec
        const buffer = this.ctx.createBuffer(1, bufferSize, this.ctx.sampleRate);
        const data = buffer.getChannelData(0);
        for (let i = 0; i < bufferSize; i++) {
          data[i] = Math.random() * 2 - 1;
        }

        const noise = this.ctx.createBufferSource();
        noise.buffer = buffer;

        const filter = this.ctx.createBiquadFilter();
        filter.type = 'lowpass';
        filter.frequency.setValueAtTime(200, this.ctx.currentTime);
        filter.frequency.linearRampToValueAtTime(1500, this.ctx.currentTime + 0.1);
        filter.frequency.linearRampToValueAtTime(200, this.ctx.currentTime + 0.4);

        const gain = this.ctx.createGain();
        gain.gain.setValueAtTime(0.2, this.ctx.currentTime);
        gain.gain.exponentialRampToValueAtTime(0.01, this.ctx.currentTime + 0.4);

        noise.connect(filter);
        filter.connect(gain);
        gain.connect(this.ctx.destination);
        noise.start();
      }

      playShatter() {
        if (!this.enabled) return;
        // 1. Noise Burst
        const bufferSize = this.ctx.sampleRate * 0.3;
        const buffer = this.ctx.createBuffer(1, bufferSize, this.ctx.sampleRate);
        const data = buffer.getChannelData(0);
        for (let i = 0; i < bufferSize; i++) {
          data[i] = Math.random() * 2 - 1;
        }
        const noise = this.ctx.createBufferSource();
        noise.buffer = buffer;

        const filter = this.ctx.createBiquadFilter();
        filter.type = 'highpass';
        filter.frequency.value = 1000;

        const gain = this.ctx.createGain();
        gain.gain.setValueAtTime(0.4, this.ctx.currentTime);
        gain.gain.exponentialRampToValueAtTime(0.01, this.ctx.currentTime + 0.3);

        noise.connect(filter);
        filter.connect(gain);
        gain.connect(this.ctx.destination);
        noise.start();

        // 2. High Tones (Glass shards)
        for (let i = 0; i < 3; i++) {
          const osc = this.ctx.createOscillator();
          osc.type = 'triangle';
          osc.frequency.value = 2000 + Math.random() * 3000;
          const oscGain = this.ctx.createGain();
          oscGain.gain.setValueAtTime(0.1, this.ctx.currentTime);
          oscGain.gain.exponentialRampToValueAtTime(0.01, this.ctx.currentTime + 0.2);
          osc.connect(oscGain);
          oscGain.connect(this.ctx.destination);
          osc.start();
          osc.stop(this.ctx.currentTime + 0.2);
        }
      }
    }

    const soundManager = new SoundManager();

    // --- Scene Setup ---
    const scene = new THREE.Scene();
    scene.background = new THREE.Color(CONFIG.bgColor);
    scene.fog = new THREE.FogExp2(CONFIG.bgColor, 0.012);

    const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);

    // Camera Orbit State
    let cameraAngle = 0;
    const cameraRadius = 25;
    const cameraHeight = 3;

    function updateCamera() {
      camera.position.x = Math.sin(cameraAngle) * cameraRadius;
      camera.position.z = Math.cos(cameraAngle) * cameraRadius;
      camera.position.y = cameraHeight;
      camera.lookAt(0, 5, 0);
    }
    updateCamera();

    const renderer = new THREE.WebGLRenderer({ antialias: true });
    renderer.setSize(window.innerWidth, window.innerHeight);
    renderer.shadowMap.enabled = true;
    renderer.shadowMap.type = THREE.PCFSoftShadowMap;
    document.body.appendChild(renderer.domElement);

    // --- Lighting ---
    const ambientLight = new THREE.AmbientLight(0xffffff, 0.6);
    scene.add(ambientLight);

    const dirLight = new THREE.DirectionalLight(0xffffff, 1.2);
    dirLight.position.set(20, 50, 20);
    dirLight.castShadow = true;
    dirLight.shadow.mapSize.width = 2048;
    dirLight.shadow.mapSize.height = 2048;
    scene.add(dirLight);

    // --- Assets Loading ---
    const textureLoader = new THREE.TextureLoader();
    const loadingManager = new THREE.LoadingManager();

    const safetyTimeout = setTimeout(() => {
      console.warn("Loading timed out. Forcing start...");
      startExperience();
    }, 3000);

    loadingManager.onLoad = () => {
      console.log("All assets loaded.");
      clearTimeout(safetyTimeout);
      startExperience();
    };

    let cubeTextures = [];
    let vaseTexture;

    function loadTextureSafe(data, fallbackColor) {
      if (!data || data.includes('PLACEHOLDER')) {
        const canvas = document.createElement('canvas');
        canvas.width = 64; canvas.height = 64;
        const ctx = canvas.getContext('2d');
        ctx.fillStyle = fallbackColor; ctx.fillRect(0, 0, 64, 64);
        return new THREE.CanvasTexture(canvas);
      }
      return textureLoader.load(data);
    }

    cubeTextures.push(loadTextureSafe(cubeData1, '#ff0000'));
    cubeTextures.push(loadTextureSafe(cubeData2, '#00ff00'));
    cubeTextures.push(loadTextureSafe(cubeData3, '#0000ff'));
    cubeTextures.push(loadTextureSafe(cubeData4, '#ffff00'));
    cubeTextures.push(loadTextureSafe(cubeData5, '#00ffff'));
    vaseTexture = loadTextureSafe(vaseData, '#ff00ff');

    // --- Objects ---
    const cubes = [];
    const vases = [];
    const particles = [];
    let floor;
    let isStarted = false;

    function startExperience() {
      if (isStarted) return;
      isStarted = true;
      const loadingEl = document.getElementById('loading');
      if (loadingEl) {
        loadingEl.style.opacity = 0;
        setTimeout(() => loadingEl.style.display = 'none', 500);
      }
      initObjects();
      animate();
    }

    function initObjects() {
      // Floor
      const floorGeo = new THREE.PlaneGeometry(300, 300, 64, 64);
      const posAttribute = floorGeo.attributes.position;
      for (let i = 0; i < posAttribute.count; i++) {
        const x = posAttribute.getX(i);
        const y = posAttribute.getY(i);
        const z = Math.sin(x * 0.05) * 2 + Math.cos(y * 0.05) * 2;
        posAttribute.setZ(i, z);
      }
      floorGeo.computeVertexNormals();
      const floorMat = new THREE.MeshStandardMaterial({
        color: CONFIG.floorColor, roughness: 0.9, metalness: 0.0, flatShading: true
      });
      floor = new THREE.Mesh(floorGeo, floorMat);
      floor.rotation.x = -Math.PI / 2;
      floor.position.y = -8;
      floor.receiveShadow = true;
      scene.add(floor);

      // Cubes
      const cubeGeo = new THREE.BoxGeometry(CONFIG.cubeSize, CONFIG.cubeSize, CONFIG.cubeSize);
      const cubeMats = cubeTextures.map(tex => new THREE.MeshStandardMaterial({ map: tex }));

      for (let i = 0; i < CONFIG.cubeCount; i++) {
        const mat = cubeMats[Math.floor(Math.random() * cubeMats.length)];
        const cube = new THREE.Mesh(cubeGeo, mat);
        cube.position.set(
          (Math.random() - 0.5) * 80,
          (Math.random() - 0.5) * 30 + 10,
          (Math.random() - 0.5) * 60
        );
        cube.rotation.set(Math.random() * Math.PI, Math.random() * Math.PI, 0);
        cube.castShadow = true;
        cube.receiveShadow = true;

        cube.userData = {
          velocity: new THREE.Vector3(
            (Math.random() - 0.5) * 0.05,
            (Math.random() - 0.5) * 0.05,
            (Math.random() - 0.5) * 0.05
          ),
          rotationSpeed: new THREE.Vector3(
            (Math.random() - 0.5) * 0.01,
            (Math.random() - 0.5) * 0.01,
            (Math.random() - 0.5) * 0.01
          ),
          isGrabbed: false
        };
        scene.add(cube);
        cubes.push(cube);
      }

      // Vases
      const vaseMat = new THREE.SpriteMaterial({ map: vaseTexture, transparent: true });
      for (let i = 0; i < CONFIG.vaseCount; i++) {
        const vase = new THREE.Sprite(vaseMat);
        vase.scale.set(CONFIG.vaseSize, CONFIG.vaseSize, 1);
        vase.position.set(
          (Math.random() - 0.5) * 70,
          (Math.random() - 0.5) * 25 + 5,
          (Math.random() - 0.5) * 50
        );
        vase.userData = {
          floatSpeed: Math.random() * 0.02 + 0.01,
          floatOffset: Math.random() * Math.PI * 2,
          baseY: vase.position.y,
          isBroken: false
        };
        scene.add(vase);
        vases.push(vase);
      }
    }

    // --- Interaction (Grab, Throw, Camera Rotate, Double Tap) ---
    const raycaster = new THREE.Raycaster();
    const mouse = new THREE.Vector2();
    let draggedCube = null;
    let dragPlane = new THREE.Plane();
    let dragOffset = new THREE.Vector3();
    let previousMousePos = new THREE.Vector3();
    let lastTime = 0;

    // Camera Control State
    let lastClientX = 0;
    let isDraggingBackground = false;

    // Double Tap State
    let lastTapTime = 0;
    let lastTappedObj = null;

    function updateMouse(event) {
      let clientX, clientY;
      if (event.changedTouches && event.changedTouches.length > 0) {
        clientX = event.changedTouches[0].clientX;
        clientY = event.changedTouches[0].clientY;
      } else {
        clientX = event.clientX;
        clientY = event.clientY;
      }
      mouse.x = (clientX / window.innerWidth) * 2 - 1;
      mouse.y = -(clientY / window.innerHeight) * 2 + 1;
      return { clientX, clientY };
    }

    function onStart(event) {
      event.preventDefault(); // Stop scrolling
      soundManager.resume();
      const { clientX } = updateMouse(event);
      lastClientX = clientX;

      raycaster.setFromCamera(mouse, camera);
      const intersects = raycaster.intersectObjects(cubes);

      if (intersects.length > 0) {
        const clickedObj = intersects[0].object;
        const now = Date.now();

        // Double Tap Detection
        if (clickedObj === lastTappedObj && now - lastTapTime < 300) {
          // LAUNCH!
          clickedObj.userData.velocity.set(
            (Math.random() - 0.5) * 4,
            (Math.random() - 0.5) * 4 + 2, // Bias upwards
            (Math.random() - 0.5) * 4
          );
          soundManager.playThrow();
          draggedCube = null; // Cancel grab
          lastTappedObj = null;
          lastTapTime = 0;
          return;
        }

        lastTapTime = now;
        lastTappedObj = clickedObj;

        // Grab Cube
        draggedCube = clickedObj;
        draggedCube.userData.isGrabbed = true;
        draggedCube.userData.velocity.set(0, 0, 0);
        soundManager.playGrab();

        const normal = new THREE.Vector3();
        camera.getWorldDirection(normal);
        dragPlane.setFromNormalAndCoplanarPoint(normal, draggedCube.position);

        const intersectPoint = new THREE.Vector3();
        raycaster.ray.intersectPlane(dragPlane, intersectPoint);
        dragOffset.subVectors(intersectPoint, draggedCube.position);

        isDraggingBackground = false;
      } else {
        // Rotate Camera
        isDraggingBackground = true;
      }
    }

    function onMove(event) {
      event.preventDefault();
      const { clientX } = updateMouse(event);

      if (draggedCube) {
        raycaster.setFromCamera(mouse, camera);
        const intersectPoint = new THREE.Vector3();
        raycaster.ray.intersectPlane(dragPlane, intersectPoint);
        if (intersectPoint) {
          draggedCube.position.copy(intersectPoint.sub(dragOffset));
        }
      } else if (isDraggingBackground) {
        // Rotate Camera logic
        const deltaX = clientX - lastClientX;
        cameraAngle -= deltaX * 0.005; // Sensitivity
        updateCamera();
      }

      lastClientX = clientX;
    }

    function onEnd(event) {
      event.preventDefault();
      if (draggedCube) {
        // Throw
        const now = performance.now();
        const dt = (now - lastTime) / 1000;

        // Increased sensitivity (x15)
        const throwVel = new THREE.Vector3().subVectors(draggedCube.position, previousMousePos).multiplyScalar(15);
        throwVel.clampLength(0, 4.0); // Higher max speed

        draggedCube.userData.velocity.copy(throwVel);
        draggedCube.userData.isGrabbed = false;
        draggedCube = null;

        if (throwVel.length() > 0.5) {
          soundManager.playThrow();
        }
      }
      isDraggingBackground = false;
    }

    // Mouse Listeners
    window.addEventListener('mousedown', onStart);
    window.addEventListener('mousemove', onMove);
    window.addEventListener('mouseup', onEnd);

    // Touch Listeners
    window.addEventListener('touchstart', onStart, { passive: false });
    window.addEventListener('touchmove', onMove, { passive: false });
    window.addEventListener('touchend', onEnd, { passive: false });


    // --- Particle System ---
    function spawnParticles(pos) {
      const particleGeo = new THREE.PlaneGeometry(0.5, 0.5);
      const particleMat = new THREE.MeshBasicMaterial({
        color: 0xffffff, side: THREE.DoubleSide, transparent: true
      });

      for (let i = 0; i < 8; i++) {
        const p = new THREE.Mesh(particleGeo, particleMat);
        p.position.copy(pos);
        p.position.x += (Math.random() - 0.5) * 2;
        p.position.y += (Math.random() - 0.5) * 2;

        p.userData = {
          vel: new THREE.Vector3(
            (Math.random() - 0.5) * 0.5,
            (Math.random() - 0.5) * 0.5,
            (Math.random() - 0.5) * 0.5
          ),
          life: 1.0
        };
        scene.add(p);
        particles.push(p);
      }
    }

    // --- Animation ---
    const clock = new THREE.Clock();

    function animate() {
      requestAnimationFrame(animate);

      const delta = clock.getDelta();
      const time = clock.getElapsedTime();
      lastTime = performance.now();

      if (draggedCube) {
        previousMousePos.copy(draggedCube.position);
      }

      // Update Cubes
      cubes.forEach(cube => {
        if (cube.userData.isGrabbed) return;

        cube.position.add(cube.userData.velocity);
        cube.rotation.x += cube.userData.rotationSpeed.x;
        cube.rotation.y += cube.userData.rotationSpeed.y;
        cube.userData.velocity.multiplyScalar(0.99);

        if (Math.abs(cube.position.x) > 80) cube.userData.velocity.x *= -1;
        if (cube.position.y > 50 || cube.position.y < -8) cube.userData.velocity.y *= -1;
        if (Math.abs(cube.position.z) > 60) cube.userData.velocity.z *= -1;

        // Collision
        if (cube.userData.velocity.length() > 0.2) {
          for (let i = vases.length - 1; i >= 0; i--) {
            const vase = vases[i];
            if (vase.userData.isBroken) continue;

            const dist = cube.position.distanceTo(vase.position);
            if (dist < (CONFIG.cubeSize / 2 + CONFIG.vaseSize / 2)) {
              // BREAK!
              soundManager.playShatter();
              spawnParticles(vase.position);
              scene.remove(vase);
              vases.splice(i, 1);
              cube.userData.velocity.multiplyScalar(-0.5);
            }
          }
        }
      });

      // Update Vases
      vases.forEach(vase => {
        vase.position.y = vase.userData.baseY + Math.sin(time * vase.userData.floatSpeed + vase.userData.floatOffset) * 0.5;
      });

      // Update Particles
      for (let i = particles.length - 1; i >= 0; i--) {
        const p = particles[i];
        p.position.add(p.userData.vel);
        p.userData.life -= delta;
        p.material.opacity = p.userData.life;
        p.rotation.z += 0.1;

        if (p.userData.life <= 0) {
          scene.remove(p);
          particles.splice(i, 1);
        }
      }

      renderer.render(scene, camera);
    }

    window.addEventListener('resize', () => {
      camera.aspect = window.innerWidth / window.innerHeight;
      camera.updateProjectionMatrix();
      renderer.setSize(window.innerWidth, window.innerHeight);
    });

  </script>
</body>

</html>
